  true,\n\t\"url\": null,\n\t\"notes\": \"An x,y,z scattered data file for the 3D
  geologic model of the Fallon FORGE site. Model created in Earthvision by Dynamic
  Graphic Inc. The model was constructed with a grid spacing of 100 m. Geologic surfaces
  were extrapolated from the input data using a minimum tension gridding algorithm.nnThe
  data file is tabular data in a text file, with lithology data associated with X,Y,Z
  grid points. All the relevant information is in the file header (the spatial reference,
  the projection etc.) In addition all the fields in the data file are identified
  in the header.n\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
